import styled, { ThemeProvider } from 'styled-components';

function Button({ ...props }) {
	Button.defaultProps = {
		theme: {
			main: 'transparent',
		},
	};

	const theme = {
		default: {
			background: 'transparent',
			texhover: '#5e90e6',
			text: 'black',
		},
		pill: {
			background: '#6bbcff',
			hover: '#5e90e6',
			text: 'black',
		},
		primary: {
			background: 'transparent',
			hover: 'rgb(116, 140, 248)',
			text: 'black',
		},
	};

	return (
		<ThemeProvider theme={theme}>
			<Button>{props.children}</Button>
		</ThemeProvider>
	);
}

export default Button;
